import React from 'react'
import Tile from './Tile'


export default class Portfolio extends React.Component {
  render() {
    return (
      <div className='grid'>
      <Tile style={{display:'flex'}}/>
      <Tile />
      <Tile />
      <Tile />
      </div>
    )
  }
}
